ControlPropertyState.AutoRuleBindingString:
UpdateContext(
    {
        varHistoricoExpandidoDetalhado: If(
            varHistoricoExpandidoDetalhado = ThisItem.nivel_1,
            Blank(),
            ThisItem.nivel_1
        )
    }
);

ClearCollect(
    colBaseOrcamentoDetalhado,
    Filter(
        db_fin_base_orcamentaria,
        id_contrato_empreendimento = ThisItem.id_contrato_empreendimento && 
        nivel_1 = ThisItem.nivel_1 && nivel_2 <> "00" &&
        orcamento_ativo = "Ativo"
    )
);

If(
    Self.Icon = Icon.ChevronDown,
    Set(
        varQuantidadeItensDetalhado,
        0
    ),
    Set(
        varQuantidadeItensDetalhado,
        CountRows(colBaseOrcamentoDetalhado)
    )
);
